import * as React from 'react';
import { Text, View } from 'react-native';

function AccountScreen() {
  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Text>Setting</Text>
    </View>
  );
}

export default AccountScreen
